// src/pages/NovoTutor.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function NovoTutor() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    dataCadastro: new Date().toISOString().split('T')[0]
  });
  const [erro, setErro] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post('/tutores', form);
      navigate('/tutores');
    } catch (err) {
      setErro(err.response?.data?.erro || 'Erro ao cadastrar tutor');
    }
  };

  return (
    <div className="container my-5">
      <h2>Cadastrar Novo Tutor</h2>
      <Link to="/tutores" className="btn btn-link mb-3">← Voltar</Link>

      {erro && <div className="alert alert-danger">{erro}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
        </div>

        <div className="mb-3">
          <label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
        </div>

        <div className="mb-3">
          <label className="form-label">Endereço</label>
          <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
        </div>

        <div className="mb-3">
          <label className="form-label">Data de Nascimento</label>
          <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
        </div>

        <button type="submit" className="btn btn-primary">Cadastrar Tutor</button>
      </form>
    </div>
  );
}
